import React from "react";

import { menuData } from "../data";

import { motion } from "framer-motion";

import {
  fadeIn,
  staggerContainer,
} from "../variants";

const Menu = () => {
  const {
    title,
    subtitle,
    modelImg,
    menuItems,
    btnText,
  } = menuData;
  return (
    <section className="bg-pink-200 min-h-[780px]">
      <div className="bg-yellow-200 h-[780px] bg-menu absolute w-full -z-0 max-w-[1800px]"></div>
    </section>
  );
};

export default Menu;
